// AgentSystemServiceServer is the server API for AgentSystemService service.
type AgentSystemServiceServer interface {
	// 获取用户推广员信息
	GetUserAgentInfo(context.Context, *GetUserAgentInfoReq) (*GetUserAgentInfoResp, error)
	// 推广员申请提交
	AgentApply(context.Context, *AgentApplyReq) (*AgentApplyResp, error)
	// 绑定推广员
	BindAgentNumber(context.Context, *BindAgentNumberReq) (*BindAgentNumberResp, error)
	// 推广中心主页信息
	AgentMainInfo(context.Context, *AgentMainInfoReq) (*AgentMainInfoResp, error)
	// 账户明细收益趋势图
	AgentAccountIncomeChart(context.Context, *AgentAccountIncomeChartReq) (*AgentAccountIncomeChartResp, error)
	// 账户明细详情列表
	AgentAccountRecordList(context.Context, *AgentAccountRecordListReq) (*AgentAccountRecordListResp, error)
	// 平台咖豆商城配置
	PlatformBeanShopConfig(context.Context, *PlatformBeanShopConfigReq) (*PlatformBeanShopConfigResp, error)
	// 推广员自定义咖豆商城配置
	AgentDiyBeanShopConfig(context.Context, *AgentDiyBeanShopConfigReq) (*AgentDiyBeanShopConfigResp, error)
	// 推广员游戏咖豆商城配置
	AgentGameBeanShopConfig(context.Context, *AgentGameBeanShopConfigReq) (*AgentGameBeanShopConfigResp, error)
	// 咖豆收支明细
	AgentBeanAccountRecordList(context.Context, *AgentBeanAccountRecordListReq) (*AgentBeanAccountRecordListResp, error)
	// 咖豆管理上下架
	AgentBeanShopUpStatus(context.Context, *AgentBeanShopUpStatusReq) (*AgentBeanShopUpStatusResp, error)
	// 咖豆管理(新增、删除)
	AgentBeanShopUpdate(context.Context, *AgentBeanShopUpdateReq) (*AgentBeanShopUpdateResp, error)
	// 推广下属用户列表
	AgentMemberList(context.Context, *AgentMemberListReq) (*AgentMemberListResp, error)
	// 赠送下属成员咖豆
	AgentGiveMemberBean(context.Context, *AgentGiveMemberBeanReq) (*AgentGiveMemberBeanResp, error)
	// 互娱商城购买咖豆下单(预提交)
	ChessShopPurchaseBean(context.Context, *ChessShopPurchaseBeanReq) (*ChessShopPurchaseBeanResp, error)
	// 推广员成员购买咖豆回调(推广员商城) - 互娱回调
	ChessPurchaseBeanNotify(context.Context, *ChessPurchaseBeanNotifyReq) (*ChessPurchaseBeanNotifyResp, error)
	// 推广员成员购买咖豆回调(平台商城) - 互娱回调
	PlatformPurchaseBeanNotify(context.Context, *PlatformPurchaseBeanNotifyReq) (*PlatformPurchaseBeanNotifyResp, error)
	// 推广员购买咖豆下单
	AgentPurchaseBean(context.Context, *AgentPurchaseBeanReq) (*AgentPurchaseBeanResp, error)
	// 推广员余额提现
	BalanceWithdrawal(context.Context, *BalanceWithdrawalReq) (*BalanceWithdrawalResp, error)
	// 推广员充值咖豆回调
	RechargeNotify(context.Context, *RechargeNotifyReq) (*RechargeNotifyResp, error)
	// 开通推广员
	OpenAgent(context.Context, *OpenAgentReq) (*OpenAgentResp, error)
	// 获取用户推广员开通状态
	GetAgentOpenStatus(context.Context, *GetAgentOpenStatusReq) (*GetAgentOpenStatusResp, error)
}

